import 'package:equatable/equatable.dart';import 'package:flutter/material.dart';@immutableclass FeedbackMd extends Equatable {  final int? id;  final String? feedback;  final String? userId;  final int? rating;  final String? imageUrl;  const FeedbackMd({    this.id,    this.feedback,    this.userId,    this.rating,    this.imageUrl,  });  @override  List<Object?> get props => [        id,        feedback,        userId,        rating,        imageUrl,      ];  factory FeedbackMd.fromJson(Map<String, dynamic> json) {    try {      return FeedbackMd(        id: json['id'],        feedback: json['feedback'],        userId: json['user_id'],        rating: json['rating'],        imageUrl: json['image_url'],      );    } catch (e) {      debugPrint("Error: $e");      return const FeedbackMd();    }  }  Map<String, dynamic> toJson() {    return {      'id': id,      'feedback': feedback,      'user_id': userId,      'rating': rating,      'image_url': imageUrl,    };  }}